import React from 'react';



function footer(){
    const FootStyle = {
        textAlign:"center",
        backgroundColor:"black",
        lineHeight: "100px",
        color:"white"
    }
    return(
        <div className="footer" style={FootStyle}>
            <p>&copy; Hong Di Chen Forever</p>
        </div>
    )
}

export default footer
